def get_h0_env(q, chi):
    #c = np.array([-1.0]).reshape(1,1)
    #t1 = np.array([1.0, 0.0]).reshape(1,2,1)
    #t2 = np.array([1.0, 0.03162277]).reshape(1,2,1)
    
    c = -np.ones((1,1))
    if q == 3:
        t1 = np.array([3.70262936e-10, 1.00000000e+00, 4.32811160e-10]).reshape(1,q,1)
        t2 = np.array([1., 0.01291102, 0.02236254]).reshape(1,q,1)
    else:
        t1 = np.zeros((1,q,1))
        t1[0,0,0] = 1.0
        t2 = np.zeros((1,q,1))
        t2[0,0,0] = 1.0
        if q >= 2:
            t2[0,1,0] = 0.02236068
        if q >= 3:
            t2[0,2,0] = 0.01291102
    
    env = ctm.CTMEnv1x1InvSymm(1,1,1,float)
    env.c = c
    env.t1 = t1
    env.t2 = t2
    return env.lift(chi)

